import React from 'react'
import Button from './button'
import styled from 'styled-components'

const Text = styled.p`
  margin: 0 24px;
`

const Inner = styled.div`
  align-items: center;
  display: flex;
`

const Container = styled.div`
  display: flex;
  flex-direction: column;
  background-color: red;
  max-width: 128px;
`

const Options = () => {
  return (
    <Container>
      <p>Prueba encontrada #1:</p>
      <Inner>
        <Button left />
        <Text>Sin pruebas</Text>
        <Button />
      </Inner>
    </Container>
  )
}

export default Options
